  flex: 1;
  text-align: center;
}

.icon {
  cursor: pointer;
}

/* Media */
.overlay-background {
  background-color: rgba(0, 0, 0, 0.1);
}

.box-shadow,
.box-shadow--left,
.box-shadow--right {
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.3);
}

.video-player {
  position: relative;
}

.video {
  border-radius: 0.2em;
  overflow: hidden;
}

.video--with-thumbnail {
  display: none;
}

.play-button {
  background-color: rgba(0, 0, 0, 0.45);
  /*   background-image: url("../assets/icons/play-button.svg"); */
  background-position: center;
  background-repeat: no-repeat;
  z-index: 10;
  cursor: pointer;
}

.play-button svg {
  position: absolute;
  top: 45%;
  left: 45%;
}

.gallery {
  margin: 10vw 0 10vw 5vw;
  padding: 2em 0;
  border-radius: 0.2em;
  background-color: rgba(50, 47, 61, 0.25);
}

.arrow {
  margin-left: 3em;
  margin-bottom: 1vw;
  display: inline-block;
}

.swiper-slide {
  min-width: 200px;
  max-width: 300px;
}

/* Menu */
.menu-wrapper {
  max-width: 75rem;
  margin: 3em auto;
}

.menu {
  margin: 0 2vw;
  border: 1px solid #322f3d;
  border-radius: 0.2em;
}

.menu__list {
  padding: 3vw;
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(250px, auto));
  grid-gap: 1em 2em;
  grid-auto-flow: dense;
}

.item {
  margin: 1em;
}

.item__name {
  font-weight: 700;
}

.item__price {
  float: right;
  font-size: 0.75em;
  font-style: italic;
}

.item__description {
  padding-left: 1em;
  max-width: 80%;
  display: block;
  font-size: 0.75em;
}

.menu__media {
  display: none;
}

.specialties {
  grid-row: span 2;
}

/* Nav */
.navbar {
  width: 100%;
  padding: 0.5em 0;
  z-index: 100;
  background-color: #ffffff;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  display: flex;
  align-items: center;
}

.navbar--fixed {
  position: fixed;
  top: 0px;
  left: 0px;
}

.navbar__menu-toggle {
  margin-left: 3vw;
  margin-right: 1em;
}

.navbar__phone {
  margin-left: 1em;
  margin-right: 3vw;
}

.nav {
  flex: 2 1 auto;
  text-align: right;
}

.nav span {
  margin: 0 1rem;
}

.nav-link {
  /*   margin: 0 1rem; */
  font-family: 'Source Sans Pro', Verdana, sans-serif;
  transition-property: color, font-weight;
  transition-duration: 400ms;
  transition-timing-function: ease;
}
.nav-link:hover {
  font-weight: 700;
  color: rgba(50, 47, 61, 0.75);
  cursor: pointer;
}

/* Typography */
.headline,
.headline--large,
.headline--medium,
.headline--small {
  margin-top: 0;
  margin-bottom: 0;
  font-family: 'Source Serif Pro', Georgia, serif;
  font-weight: 700;
  color: #322f3d;
  line-height: 1.2;
  letter-spacing: -0.05em;
}

.headline--large {
  font-size: 3.157em;
}

.headline--medium {
  font-size: 2.369em;
}

.headline--small {
  margin-bottom: 0.5em;
  font-size: 1.777em;
}

.headline--indent {
  padding: 0 5vw;
}

.block-quote {
  padding: 0.75em 0;
  border-top: 1px solid rgba(50, 47, 61, 0.25);
  border-bottom: 1px solid rgba(50, 47, 61, 0.25);
  font-family: 'Source Serif Pro', Georgia, serif;
  text-align: center;
}

.title {
  margin-bottom: 1em;
  border-bottom: 1px solid rgba(50, 47, 61, 0.25);
  font-family: 'Source Sans Pro', Verdana, sans-serif;
  font-size: 0.85em;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: rgba(50, 47, 61, 0.25);
}

.footer-text {
  margin: 1em 0;
  font-family: 'Source Sans Pro', Verdana, sans-serif;
  text-transform: uppercase;
}

.newsletter {
  margin: 1em 0;
}

.newsletter__text {
  margin: 0;
  font-weight: 700;
  color: rgba(50, 47, 61, 0.5);
}

.newsletter__input {
  margin-right: -5px;
  padding: 0.5em 1em;
  border: 1px solid #322f3d;
  border-right: none;
  border-radius: 0.2em;
}

.copyright {
  margin: 0.5em 0;
  text-align: center;
  font-size: 0.75em;
  color: rgba(50, 47, 61, 0.25);
}

/* Media Queries */
@media only screen and (min-width: 48em) {
  /* Layout */
  .container {
    margin: 5vw 0;
    padding: 0;
    display: flex;
    flex-direction: row;
  }
  .container--reverse {
    flex-direction: row-reverse;
  }
  .container__media {
    flex: 2;
    margin-bottom: 0;
  }
  .container__info {
    padding-left: 5vw;
    flex: 1;
  }
  /* Logo */
  .logo {
    text-align: left;
  }
  /* Media */
  .box-shadow--left {
    box-shadow: -4px 4px 8px 0 rgba(0, 0, 0, 0.3);
  }
  .box-shadow--right {
    box-shadow: 4px 4px 8px 0 rgba(0, 0, 0, 0.3);
  }
  .gallery {
    padding: 3vw 0;
  }
  /* Media */
  .menu-wrapper {
    margin: 5vw auto;
  }
  .menu {
    border-width: 2px;
  }
  .menu__list {
    grid-template-columns: 1fr 1fr;
  }
  .menu__media {
    margin: 1em 0;
    display: block;
    background: url('https://preview.ibb.co/c9JEB9/dark_pudding.jpg')
      center/cover no-repeat content-box;
    border-radius: 0.2em;
    grid-column: 2;
    grid-row: 1 / span 1;
  }
  .specialties {
    grid-row: span 1;
  }
  .cupcake {
    grid-column: 2;
  }
}

@media only screen and (min-width: 62em) {
  /* Layout */
  .container__info {
    font-size: 1.125em;
  }
  /* Media */
  .gallery {
    font-size: 1.125em;
  }
  /* Menu */
  .menu-wrapper {
    font-size: 1.125em;
  }
  /* Typography */
  .block-quote {
    font-size: 1.125em;
  }
}

/* ==========================================================================
 * States
 * ========================================================================== */
/* Display */
@media only screen and (min-width: 48em) {
  .is-displayed-mobile {
    display: none;
  }
}

.is-hidden-mobile {
  display: none;
}
@media only screen and (min-width: 48em) {
  .is-hidden-mobile {
    display: block;
  }
}
